import { useState } from 'react';
import './Vote.css';

export function VoteSticky(sticky,setStickies) {

    var[counter,setCounter]=useState(0);

    const increase=() => {
        setCounter(counter=counter+1);
        //sticky.vote
    }
    const decrease = () => {
        if(counter>0)
        {
            setCounter(counter=counter-1);
            //sticky.vote
        }

    }

    return(
        <div className='voteMenu'>
            <p className='counter'>{counter}</p>
            <button className='updateMinus' onClick={decrease}>-</button>
            <button className='updatePlus' onClick={increase}>+</button>
        </div>
    );
}
